import Navbar from "./navbar";
import img from "./img/imagehome.jpg";
import Tilt from "react-tilt";
import Typewriter from "typewriter-effect";
import './headerstyle.css';



export default function Header(){


    return (
        <div>
            <Navbar />
            <div className="flex  w-full px-15percent mt-10">
                <div className="w-4/6 mx-auto my-auto">
                    <div className="flex py-5">
                        <p className="text-5xl font-semibold">Hello, </p>
                        <div className="text-5xl font-extrabold text-teal-500 font-mono">
                            <Typewriter options={{strings: ['I\'m Zam', 'I\'m Software Engineer'],autoStart: true,loop: true,}}/>
                        </div>
                    </div>
                    <p className="text-3xl">For the past four years, I've worked as a software engineer, assisting numerous firms and projects in developing the technology systems they require, such as websites and mobile applications, as well as developing server programs.</p>
                </div>
                <div className="w-2/6">
                    <Tilt className="Tilt" options={{max : 5}}>
                            <img className="Imagehover w-8/12 mx-auto" src={img} alt="muzamilH"/>
                    </Tilt>
                </div>
            </div>
        </div>
    )
}
